<template>
  <div>
    <v-container fluid>
      <v-row no-gutters>
        <v-col md="3" class="text-left">
          <v-btn icon>
            <v-menu
              ref="menu"
              v-model="menu"
              :close-on-content-click="false"
              :return-value.sync="date"
              transition="scale-transition"
              offset-y
              min-width="290px"
            >
              <template v-slot:activator="{ on }">
                <v-icon v-on="on">mdi-calendar</v-icon>
              </template>
              <v-date-picker
                v-model="date"
                :show-current="false"
                type="month"
                scrollable
              >
                <v-spacer></v-spacer>
                <v-btn text color="primary" @click="menu = false">Cancel</v-btn>
                <v-btn text color="primary" @click="changeDate">OK</v-btn>
              </v-date-picker>
            </v-menu>
          </v-btn>

          <v-btn icon class="ml-2" @click="print_pdf()">
            <v-icon>mdi-printer</v-icon>
          </v-btn>

          <v-btn icon class="ml-2" @click="obtener_datos()">
            <v-icon>mdi-refresh</v-icon>
          </v-btn>
        </v-col>
      </v-row>

      <v-row v-if="isLoading">
        <v-col class="text-center">
          <v-progress-circular
            :size="50"
            indeterminate
            color="primary"
          ></v-progress-circular>
        </v-col>
      </v-row>

      <div v-if="!isLoading" style="overflow-x: auto">
        <div id="table-reporte">
          <v-row justify="center" class="text-center" align="center">
            <v-col md="6" align-self="center">
              <table class="table">
                <tr>
                  <td class="logo">
                    <v-img
                      max-height="150"
                      max-width="150"
                      src="@/assets/logo_muni.png"
                    ></v-img>
                  </td>
                  <td class="centro">
                    <h3>RESULTADOS DE CONTROL DE CALIDAD</h3>
                    <h4>{{ date }}</h4>
                  </td>
                  <td>
                    <tr>
                      <td class="codigo">
                        <h5>CÓDIGO:</h5>
                        <h5>RED-GCC-0006</h5>
                      </td>
                    </tr>
                    <tr>
                      <td class="version">
                        <h5>VERSIÓN:</h5>
                        <h5>0003</h5>
                      </td>
                    </tr>
                  </td>
                </tr>
              </table>
            </v-col>
          </v-row>

          <v-row>
            <v-col>
              <table id="reporte" class="table_reporte text-center">
                <tr v-for="(header, key) in headers" :key="key">
                  <td
                    :class="item.CLASS"
                    :style="'min-width: ' + item.WIDTH"
                    :colspan="item.COLSPAN"
                    v-for="(item, key) in header"
                    :key="key"
                  >
                    {{ item.TEXT }}
                  </td>
                </tr>
                <tr v-for="(row_item, key) in items" :key="row_item.DOCUMENTO">
                  <td>{{ key + 1 }}</td>
                  <td>{{ row_item.USUARIO }}</td>
                  <td>{{ row_item.FECHA_INGRESO }}</td>
                  <!-- <td></td>
									<td></td> -->
                  <td>{{ row_item.DOCUMENTO }} - {{ row_item.ANIO }}</td>
                  <td>{{ row_item.FECHA_FINALIZACION }}</td>

                  <!-- Criterios -->
                  <td v-for="(criterio, key) in row_item.CRITERIOS" :key="key">
                    {{ criterio != '2' ? criterio : '-' }}
                  </td>

                  <td>0</td>
                  <td>Aceptado</td>
                  <td>{{ row_item.ENCARGADO_CALIDAD }}</td>
                </tr>
              </table>
            </v-col>
          </v-row>
        </div>
      </div>
    </v-container>
  </div>
</template>

<style scoped>
.table {
  border-collapse: collapse;
}
.logo {
  padding: 8px;
  border: 1px solid #ddd;
}
.centro {
  padding: 8px;
  border-top: 1px solid #ddd;
  border-bottom: 1px solid #ddd;
  border-right: 1px solid #ddd;
}
.codigo {
  padding: 8px;
  border-top: 1px solid #ddd;
  border-right: 1px solid #ddd;
  border-bottom: 1px solid #ddd;
}
.version {
  padding: 8px;
  border-right: 1px solid #ddd;
  border-bottom: 1px solid #ddd;
}

.table_reporte tr td {
  border-collapse: collapse;
  padding: 4px;
  border: 1px solid #ddd;
}
.table_reporte th {
  position: -webkit-sticky;
  position: sticky;
  left: 0;
  background: #fff;
  border: 1px solid #ddd;
}
</style>

<script>
// eslint-disable-next-line no-unused-vars
import { jsPDF } from "jspdf";
import "jspdf-autotable";

export default {
  data() {
    return {
      date: new Date().toISOString().substr(0, 7),
      menu: false,
      modal: false,
      breadcrumb: [
        {
          text: "Reportes",
          disabled: true,
          href: "breadcrumbs_dashboard",
        },
      ],
      headers: [],
      items: [],
      isLoading: false,
    };
  },
  methods: {
    changeDate() {
      this.$refs.menu.save(this.date);

      this.obtener_datos();
    },
    obtener_datos() {
      this.isLoading = true;

      let data = {
        name: "generar_reportes",
        param: {
          fecha: this.date,
        },
      };

      this.axios.post(process.env.VUE_APP_API_URL, data).then((response) => {
        // eslint-disable-next-line no-console
        this.headers = response.data.response.result.headers;
        this.items = response.data.response.result.items;

        this.isLoading = false;
      });
    },
    print_pdf() {

		const doc = new jsPDF("l", "mm", [216, 356]);

		var logo = 'data:image/jpeg;base64,'

		doc.addImage(logo, 'JPG', 130, 10, 100, 20)

		doc.autoTable({
			html: "#reporte",
			startY: 35,
			margin: { left: 5, right: 5 },
			CellDef: { styles: { cellWidth: "auto" } },
			theme: "plain",
			styles: {
			fontSize: 5,
			cellWidth: "auto",
			lineWidth: 0.1,
			halign: "center",
			},
			columnStyles: { 3: { minCellWidth: 20 }, 4: { minCellWidth: 20 } },
		});

		doc.save("Reporte " + this.date + ".pdf");
	},
	obtener_usuario(){

		let data = {
			name: "obtener_usuario",
			param: {

			},
		};

		this.axios.post(process.env.VUE_APP_API_URL, data)
		.then((response) => {
			// eslint-disable-next-line no-console
			console.log(response.data);
		})

	}
  },
	mounted() {

		this.obtener_usuario()

		this.obtener_datos()

	},
};
</script>